import React, { useEffect } from "react";
import Card from "./Card";

function Cards({ deck, cards = [], handleDeleteDeck }) {

    const content = cards.map((card, index) => {
        return (<>
            <Card card={card} index={index} />
        </>);
    })

    return (<>
        {content}
    </>
    );
}

export default Cards;
